  false,\n\t\"url\": null,\n\t\"notes\": \"SWFSC FED Mid Water Trawl Juvenile Rockfish
  Survey: CTD Data.nSurveys have been conducted along the central California coast
  in May/June nevery year since 1983. In 2004 the survey area was expanded to cover
  the nentire coast from San Diego to Cape Mendocino.  The survey samples a series
  nof fixed trawl stations using a midwater trawl. The midwater trawl survey ngear
  captures significant numbers of approximately 10 rockfish species duringntheir pelagic
  juvenile stage (i.e., 50-150 days old), by which time annualnreproductive success
  has been established. Catch-per-unit-effort data fromnthe survey are analyzed and
  serve as the basis for predicting future nrecruitment to rockfish fisheries. Results
  for several species (e.g., nbocaccio, chilipepper [S. goodei], and widow rockfish
  [S. entomelas]) havenshown that the survey data can be useful in predicting year-class
  strengthnin age-based stock assessments.nnThe survey's data on YOY Pacific whiting
  has also been used in the stocknassessment process. To assist in obtaining additional
  northward spatialncoverage of YOY Pacific whiting off Oregon and Washington, in
  2001 thenPacific Whiting Conservation Cooperative in cooperation with the NOAA NMFSnNorthwest
  Fisheries Science Center began a midwater trawl survey patternednafter the NOAA
  NMFS SWFSC Fisheries Ecology Division's (FED) existing survey. nBoth surveys work
  cooperatively together each year in order to resolve ninterannual abundance patterns
  of YOY rockfish and Pacific whiting on a ncoastwide basis, which provides expedient,
  critical information that can be nused in the fisheries management process.nnThe
  large quantity of physical data collected during the surveys (e.g., CTDnwith attached
  transimissometer and fluorometer, thermosalinometer, and ADCP)nhave provided a better
  understanding of the hydrographic conditions off thenCalifornia coast and analysis
  of these data have been distributed through thenpublication of NOAA NMFS Technical
  Memoranda.nnFor more information, see https://swfsc.noaa.gov/GroundfishAnalysis/
  andnhttp://www.sanctuarysimon.org/projects/project_info.php?projectID=100118\",\n\t\"owner_org\":
